import React from "react";
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';

const styles = {
    jumbotron: {
        textAlign: "center",
        background: "#1d3557",
        color: "white",
        height: 100
    }
};

function Home() {
    return (
        <div>
            <Jumbotron fluid style={styles.jumbotron}>
                <Container>
                    <h1>Employee Directory</h1>
                </Container>
            </Jumbotron>
        </div>
    )
}

export default Home;
